import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

//components
import Button from '../src/components/dashboard/Buttom'

const cookies = new Cookies();

const dashboard = () => {
    return (
        <Layout>
            <Container fluid>
                <Row sm={12} md={12} lg={12} className="justify-content-md-center row-1">
                    <Col sm md={2} lg={2} className="justify-content-md-center colm">
                        hola
                    </Col>
                    <Col sm md={10} lg={10} className="justify-content-md-center colm">
                        hola
                    </Col>
                </Row>
                <Row sm={12} md={12} lg={12} className="justify-content-md-center row-2">
                    <Col sm md={2} lg={2} className="justify-content-md-center colm">
                        hola
                    </Col>
                    <Col sm md={10} lg={10} className="justify-content-md-center colm">
                        hola
                    </Col>
                </Row>
            </Container>
            <style global jsx>{`
                *{
                    box-sizing: border-box;
                }
                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    height: 100%;
                    margin:0; padding:0;
                }

                .row-1{
                    color: blue;
                    border: solid 1px;
                    width: 100%;
                    height: 5%;
                    margin: 0;
                    padding: 0;
                }
                .row-2{
                    color: blue;
                    border: solid 1px;
                    width: 100%;
                    height: 95%;
                    margin: 0;
                    padding: 0;
                }
                .colm{
                    width: 100%;
                }
            `}</style>
        </Layout>
    );
}

export default dashboard;
